class Solution(object):
    def numberOfBeautifulIntegers(self, low, high, k):
        """
        :type low: int
        :type high: int
        :type k: int
        :rtype: int
        """
        def is_beautiful(n):
            even = odd = 0
            while n:
                last_digit = n % 10
                if last_digit % 2 == 0:
                    even += 1
                else:
                    odd += 1
                n //= 10
            return even == odd

        count = 0
        for num in range(low, high + 1):
            if num % k == 0 and is_beautiful(num):
                count += 1
        return count
